import React, { useState } from 'react'

const Cart = ({cart}) => {

  const [] = useState(cart)
  return (
    <div>
      <h2>Cart</h2>
      <div>{cart.map((data)=>{
        return(
          <>
            <div>data.id</div>
          </>
        )
      })}</div>
    </div>
  )
}

export default Cart
